import React, {useState, useEffect} from "react";
import {showErrorMessage, showSuccessMessage} from "../../actions/notification";
import {Card, Col, Row} from "react-bootstrap";
import {Modal} from "antd";
import {useDispatch, useSelector} from "react-redux";
import {setHeaderTitle} from "../../store/actions/HeaderAction";
import {Form, Input, Button, Select} from 'antd';
import "./style.css";
import {useHistory, useParams} from "react-router-dom";
import {getChanged} from "../../services/AppService";
import {CircularProgress} from "@material-ui/core";
import ModuleService from "../../services/ModuleService";
import {ACTIONS, LogPageView, PAGES} from "../../services/LogService";
import {checkPermissionStyle, checkPermissionTextView} from "../../services/CognitoService";

const {Option} = Select;


export default function AddModule(props) {
    const dispatch = useDispatch();
    const history = useHistory();
    const [modalCancelVisible, setModalCancelVisible] = useState(false);
    const [data, setData] = useState();
    const [workouts, setWorkouts] = useState([]);
    const {id} = useParams();
    const isEditMode = !(!id);
    const user = useSelector(state => state.auth.user);

    useEffect(() => {
        LogPageView(PAGES.MODULE, isEditMode ? ACTIONS.EDIT : ACTIONS.ADD, {id});
        dispatch(setHeaderTitle(isEditMode ? `${checkPermissionTextView('edit', 'module-management')} Module` : "Add New Module"));
    }, []);

    useEffect(() => {
        if (isEditMode) {
            ModuleService.get(id).then(value => {
                if (value) {
                    setData(value.data);
                }
            })
        }
    }, [isEditMode]);


    const onCancel = () => {
        props.history.goBack();
    };

    const onFinish = (values) => {
        values.name = (values.name || '').trim();

        if (!values.name) {
            return showErrorMessage("Name must not be empty!");
        }

        if (isEditMode) {
            ModuleService.update(data.id, getChanged(data, values)).then(value => {
                if (value) {
                    showSuccessMessage("Updated Module Successfully!!");
                    history.goBack();
                }
            })
        } else {
            ModuleService.create(values).then(value => {
                if (value) {
                    showSuccessMessage("Added Module Successfully!!");
                    history.goBack();
                }
            })
        }
    };

    const onFinishFailed = (errorInfo) => {
        console.log('Failed:', errorInfo);
    };


    return (
        <>
            {
                !isEditMode || data ? (
                    <Form
                        initialValues={data}
                        layout="vertical"
                        onFinish={onFinish}
                        onFinishFailed={onFinishFailed}
                    >
                        <div className="row">
                            <div className="col-md-12">
                                <div className="kt-section">
                                    <Card>
                                        <Card.Body>

                                            <Row>
                                                <Col>
                                                    <Form.Item label="Name" name="name">
                                                        <Input/>
                                                    </Form.Item>
                                                </Col>
                                            </Row>
                                            <Row>
                                                <Col>
                                                    <Form.Item label="Status" name="status" initialValue={'active'}>
                                                        <Select>
                                                            <Select.Option value={'active'}>Active</Select.Option>
                                                            <Select.Option value={'inactive'}>Inactive</Select.Option>
                                                        </Select>
                                                    </Form.Item>
                                                </Col>
                                            </Row>
                                            <Form.Item>
                                                <Button style={{marginRight: 12}} type="primary"
                                                        htmlType="submit" {...checkPermissionStyle('edit', 'module-management', true, isEditMode)}>
                                                    Submit
                                                </Button>
                                                <Button htmlType="button"
                                                        onClick={() => setModalCancelVisible(true)}>
                                                    Cancel
                                                </Button>
                                            </Form.Item>
                                        </Card.Body>
                                    </Card>
                                    <Modal
                                        title={`Cancel ${isEditMode ? checkPermissionTextView('edit', 'module-management') : 'Add'} Module`}
                                        visible={modalCancelVisible}
                                        onOk={() => onCancel()}
                                        onCancel={() => setModalCancelVisible(false)}
                                        cancelText="Cancel"
                                        okText="Ok">
                                        <p>Do you want to cancel and quit ?</p>
                                    </Modal>
                                </div>
                            </div>
                        </div>
                    </Form>
                ) : <CircularProgress size={20}/>
            }
        </>
    );
};
